import pandas as pd

# Sample DataFrames
df1 = pd.DataFrame({
    'key1': ['A', 'B', 'C', 'D'],
    'value1': [1, 2, 3, 4]
})

df2 = pd.DataFrame({
    'key2': ['A', 'B', 'E', 'F'],
    'value2': [5, 6, 7, 8]
})

# Joining DataFrames on different key columns
result = pd.merge(df1, df2, left_on='key1', right_on='key2', how='inner')
print(result)

